import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.min';
import $ from 'jquery';
import {Link} from 'react-router-dom';

import '../../Style/Mobile/Mobilenav.css';


class Mobilenav extends React.Component {

    componentDidMount = () => {

    }

    render(){
      

        return (
            <div className= "Mobilenavigation">

                <nav className="navbar navbar-expand-lg navbar-dark main-mobile-nav" id="myHeader">
                    <button className="navbar-toggler main-toggle-icon" type="button" data-toggle="collapse"
                            data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent"
                            aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>

                    <div className="collapse navbar-collapse inner-nav-div" id="navbarSupportedContent">
                        <ul className="navbar-nav mr-auto">
                            <li className="nav-item">
                                <a className="nav-link mobile-nav-a" href="#">HOME</a>
                            </li>
                            <li className="nav-item ">
                                <a className="nav-link mobile-nav-a" href="#">PORTFOLIO</a>
                            </li>

                            <li className="nav-item ">
                                <a className="nav-link mobile-nav-a" href="#">SKILLS</a>
                            </li>

                            <li className="nav-item ">
                                <a className="nav-link mobile-nav-a" href="#">CONTACT ME</a>
                            </li>

                            <li className="nav-item ">
                                <a className="nav-link mobile-nav-a" href="#">RESUME</a>
                            </li>
                        </ul>

                    </div>
                </nav>
            </div>
        );
    }
}

export default Mobilenav;
